.kitty-left {position: absolute;left: 10px;top: 50%;transform: translateY(-50%);width: 150px;height: auto;}</style></head><body><img class="kitty-left" src="kitty.gif" alt="Kitty Image"><div class="container"><img id="helloKitty" class="hello-kitty" src="hello.gif" alt="" onload="handleGif()">
    
    <div class="board">
      <h1>Welcome Ouma! draw something&#129392;</h1>
      <canvas id="drawingCanvas"></canvas>
      <div class="controls"><button class="control-btn" id="colorRed">Red</button><button class="control-btn" id="colorGreen">Green</button><button class="control-btn" id="colorBlue">Blue</button><button class="control-btn" id="thicknessSmall">Thin</button><button class="control-btn" id="thicknessLarge">Thick</button><button class="control-btn" id="clearBoard">Clear</button></div></div></div><img class="top-right" src="ribboo.png" alt="Ribbon"><script>const correctHash = "1c59943c6f21fb84ae8b5da01ce9fb9e7aa02df179a0441630ddd5bd5e20b444";

    async function hashPassword(password) {
      const encoder = new TextEncoder();
      const data = encoder.encode(password);
      const hashBuffer = await crypto.subtle.digest('SHA-256', data);
      const hashArray = Array.from(new Uint8Array(hashBuffer));
      return hashArray.map(byte => byte.toString(16).padStart(2, '0')).join('');
    }

    async function checkAccess() {
      const password = prompt("Enter the password to access this page:");
      if (!password) {
        alert("Access denied!");
        window.location.href = "index.html"; 
        return;
      }

      const hash = await hashPassword(password);
      if (hash === correctHash) {
        document.body.style.display = "block";
      } else {
        alert("Incorrect password. Access denied!");
        window.location.href = "index.html"; 
      }
    }

  
    window.onload = checkAccess;

    function handleGif() {
      const gif = document.getElementById('helloKitty');
      setTimeout(() => {
        gif.remove();
      }, 10000); 
    }

    const canvas = document.getElementById('drawingCanvas');
    const ctx = canvas.getContext('2d');
    canvas.width = 500;
    canvas.height = 400;

    let isDrawing = false;
    let color = 'black';
    let lineWidth = 5;

    canvas.addEventListener('mousedown', (e) => {
      isDrawing = true;
      const canvasRect = canvas.getBoundingClientRect();
      const x = e.clientX - canvasRect.left;
      const y = e.clientY - canvasRect.top;
      ctx.beginPath();
      ctx.moveTo(x, y);
    });

    canvas.addEventListener('mousemove', (e) => {
      if (isDrawing) {
        const canvasRect = canvas.getBoundingClientRect();
        const x = e.clientX - canvasRect.left;
        const y = e.clientY - canvasRect.top;
        ctx.lineTo(x, y);
        ctx.strokeStyle = color;
        ctx.lineWidth = lineWidth;
        ctx.lineCap = 'round';
        ctx.lineJoin = 'round';
        ctx.stroke();
      }
    });

    canvas.addEventListener('mouseup', () => {
      isDrawing = false;
    });

    document.getElementById('clearBoard').addEventListener('click', () => {
      ctx.clearRect(0, 0, canvas.width, canvas.height);
    });

    document.getElementById('colorRed').addEventListener('click', () => {
      color = 'red';
    });
    document.getElementById('colorGreen').addEventListener('click', () => {
      color = 'green';
    });
    document.getElementById('colorBlue').addEventListener('click', () => {
      color = 'blue';
    });

    document.getElementById('thicknessSmall').addEventListener('click', () => {
      lineWidth = 5;
    });

    document.getElementById('thicknessLarge').addEventListener('click', () => {
      lineWidth = 10;
    });
  </script>
